const Header = () => {
  const renderContent = () => {
    if (req.user) {}
  };

  return (
    <nav>
      <div class='nav-wrapper'>
        <a href='#!' class='brand-logo center'>
          Golden Moledy
        </a>
        <ul class='right hide-on-med-and-down'>
          <li>
            <a href='sass.html'>
              <i class='material-icons'>search</i>
            </a>
          </li>
          <li>
            <a href='/auth/google'>
              <i class='material-icons'>account_circle</i>
            </a>
          </li>
        </ul>
      </div>
    </nav>
  );
};

export default Header;
